  "namedInputs": {
    "default": [
      "{projectRoot}/**/*"
    ],
    "prod": [
      "!{projectRoot}/**/*.spec.tsx"
    ],
    "production": [
      "default"
    ]
  },
  "targetDefaults": {
    "build": {
      "dependsOn": [
        "^build"
      ],
      "cache": true
    },
    "test": {
      "inputs": [
        "default",
        "^prod"
      ],
      "cache": true
    },
    "dev": {
      "dependsOn": [
        "^build"
      ]
    },
    "test:coverage": {
      "outputs": [
        "{projectRoot}/coverage"
      ]
    }
  }
}
